INSERT INTO `courses` VALUES (10,'Unethical Pro-Organizational Behavior (UPB)','Alberto Maldonado','2024-08-09','Unethical Pro-Organizational Behavior (UPB) has been a HAWT topic over the last decade and continues to be very relevant today (perhaps even more so). Wait, you\'ve never heard of UPB?? Oh come on, it\'s the new trend! You know, the one where your place or work treats you very poorly and makes you feel pretty darn bad about yourself in an effort to advance the organization or for your supervisors/leaders self interest?! \n\n\n\nSee, you did know! You just didn\'t know it had a formal name ;) Let\'s learn and talk all about it! Earn 2 CEU\'s along the way!',28.00,'unethical-pro-organizational-behavior-upb','2024-08-10 00:16:55.768000','2024-08-28 15:24:06.812000','2024-08-10 00:23:49.612000',3,1,'ethical',' https://rise.articulate.com/share/1varfTd6N2RxXqAb3vVA3rveQeA7Sch9','GOOGLE.COM',0),(11,'Behavioral Artistry','Alberto Maldonado','2024-08-15','Take this course to learn about what it means to be a \"Behavioral Artist\"! Foxx\'s term has resonated with me and several other BCBA\'s who are impassioned when they give therapy. Learn about the 7 characteristics of a \"Behavioral Artist\" and earn 1 CEU!',12.00,'behavioral-artistry','2024-08-15 17:51:26.778000','2024-09-02 07:06:30.823000','2024-08-15 17:51:29.429000',3,1,'1',' https://360.articulate.com/review/content/ad042ecd-30e9-4124-8ae4-d90be84245f6/review',NULL,3),(12,'A Behavior Analytic Perspective on ANXIETY','Alberto Maldonado','2024-08-15','Anxiety is one of those tricky concepts and target behaviors for Behavior Analysts. However, with ABA being so effective, we can learn to treat individuals impacted by anxiety and other related disorders. Learn all about the conceptualization of Anxiety (and emotions in general) and earn 2 CEUs!',24.00,'ceu-a-behavior-analytic-perspective-on-anxiety','2024-08-15 18:02:35.761000','2024-09-05 19:49:45.996000','2024-08-15 18:02:37.516000',3,3,'2','https://360.articulate.com/review/content/053b2938-fae1-426a-b2cb-84b5cae77db6/review ',NULL,0),(13,'Implementing Acceptance and Commitment Training (ACTr) in ABA','Alberto Maldonado','2024-08-15','Alright, Alright! Time to get your ACT together and learn how to properly help out all these anxious individuals you\'ve been getting referred. As our field continues to grow, so does our knowledge about the mediating effects of private events (thoughts). These private events sure have a big impact on our behaviors, so let\'s learn some awesome techniques that can help.\n\n\n\nThis CEU will be examining the article by Kelly & Kelly titled,\"Acceptance and Commitment Training in Applied Behavior Analysis: Where Have You Been All My Life?\" (2021). Together, we will better understand how ACTr can be used during session to help reduce anxiety responses (and other emotional responses). No, that extra lower case \"r\" is not a typo. Find out why it\'s there!  Enjoy!',24.00,'ceu-implementing-acceptance-and-commitment-training-ac-tr-in-aba','2024-08-15 18:11:27.784000','2024-08-15 18:11:29.809000','2024-08-15 18:11:29.804000',3,3,'2',' https://360.articulate.com/review/content/f73ae034-db8e-42ad-8929-22d55b4dc476/review',NULL,0),(14,'AI-Augmented Behavior Analysis (AI-ABA): Building Towards Precision Treatment','Alberto Maldonado M.A., BCBA','2024-08-15','AI is taking over! Here come the robots! Beware!!! Kidding.....well kinda. Until AI becomes the thing of scary movies, we might as well learn LOTS about it and integrate it into our therapy to enhance the treatment we provide. This CEU will delve into a world where Artificial Intelligence Augmented Behavior Analysis (AI-ABA) can help clinicians focus on what really matters; Personalized treatment that will increase the quality of life of their awesome participant and their collaterals (e.g., family). Happy Training!',12.00,'ai-augmented-behavior-analysis-ai-aba-building-towards-precision-treatment','2024-08-15 18:16:56.016000','2024-09-05 19:53:07.887000','2024-08-15 18:16:57.662000',3,3,'1','https://360.articulate.com/review/content/c264565d-597e-46b4-8f2c-b3379888d3f7/review ',NULL,0),(15,'CEU: Test','Alberto Maldonado M.A., BCBA','2024-09-05','Test',24.00,'ceu-1','2024-09-05 19:54:55.402000','2024-09-05 19:55:11.956000','2024-09-05 19:55:11.945000',3,3,'2',' https://rise.articulate.com/share/aRRAzaRfGKtbXMd9j43fecwVwdlnuZsl',NULL,0);
